import styled from "styled-components";

const MagazineContainer = styled.section`
  background-color: #ffaa00;
  padding: 13px 0;
  display: flex;
`;

const Ttitle = styled.div``;

export default function () {
  return (
    <MagazineContainer>
      <Ttitle>
        <span></span>
        <h1>جدیدترین مطالب</h1>
      </Ttitle>
    </MagazineContainer>
  );
}
